import React from 'react';

const ForAllPage = () => {
  return (
    <div>
      <h3>For-All</h3>
      {/* Placeholder content for For-All */}
      <p>This feature is coming soon!</p>
      <p>
        For-All allows users to explore and rent a variety of housing options for different needs.
      </p>
      <p>Stay tuned for updates on the launch of this exciting new feature!</p>
    </div>
  );
};

export default ForAllPage;
